ウォッシュアンドグレーズコートインシャンプーはカーシャンプーとしての機能と高い光沢、はっ水性を両立した画期的な商品です。カルバナ等の成分は含んでおりませんので、バンパーやモールなど樹脂製品への影響も最小限に抑える事が可能です。内容量　500ml<br><br>ACTICAREカーケミカルは2014年に始動した新鋭ケミカルメーカーです。コーティング施工車からDIYでのカーケアまで素材と品質に拘りながらも「プロ級の仕上がり」でありながら、コーティング施工車からDIYでのカーケアまで使いやすさや価格などもトータルで「楽しくなる」洗車環境を皆様に提案します。<br><br>※洗車の際、パネル毎の施工をお勧めいたします。特に日差しの強い日など、乾いた場合は跡として残る事が有りますので、必ず流しながら施工して下さい。また、ご利用の際、製品裏面の使用上の注意を必ずお読みください。<br><br>ユニバーサル<br><br>車検対応品<br><br>カーケア | カーシャンプー<tr><td colspan="2">
