RH9は既にリリースされているコーティング剤「ACTICARE RH3」の高濃縮版となるプロフェッショナル向け商品です。本商品1本で5回～10回の施工が可能で、ディーラーやガソリンスタンド、ディティーリング業者様等でコーティング施工されているお車の上に施工する「オーバーコート剤」としても使用可能です。RH3と比べ、耐久性や光沢感、撥水性能が高く、当然ながらコーティング未施工車に対してもその効果は抜群です。<br>【使用方法】1、セットのウォッシュアンドグレース（WG)でシャンプー洗車をし、水でよくすすぎ流して下さい。２、次にRH9をよく振って下さい。3、ボディに水が残った状態で、クロスに本液を少量スプレーし、塗り伸ばしながら拭き上げ作業を行って下さい。4、施工後、ボディに滑り感が出るまで乾いたクロス等で丁寧に仕上げ拭きをしていただくと、より一層の光沢と撥水性能が得られます。5、洗車の毎にRH3を施工して頂くと、被膜が厚くなりより一層の膜厚と深みのある光沢が得られ、同時に耐久性も増します。<br>※直接施工の場合、まれに白く拭きムラが出る場合がございますが、その場合は濡れたクロスで再度拭く事によって除去可能です。※親水系のコーティングや、特殊な流水系コーティング施工車にも施工は可能ですが、本製品の機能が持続している間は撥水効果が強くなる恐れがあります。※RH9 内容量：100ml　※WG　内容量500ml 5-10倍希釈<br><br>カーケア | コート剤<tr><td colspan="2">
